import React, { Component } from "react";
import "../bootstrap.min.css"
import "../style_login.css"
import "../style_message.css"
import "../style.css"

export default class App extends Component {
    constructor(props) {
        super(props)
    }

    render() {
        return (
            <div>
                {this.props.children}
            </div>
        )
    }
}
